import React from 'react';

import { AvailableIcons } from '@/components/atoms/img/Icon';
import Text, { TextSize } from '@/components/atoms/text/Text';

import { ThemeColors } from '@/styles/theme';
import {
  Container,
  HeroContainer,
  LogoImg,
  HeroImg,
  StyledButton,
  ButtonContainer,
} from './styles';

const Hero: React.FC = () => (
  <Container>
    <HeroContainer>
      <div>
        <LogoImg iconName={AvailableIcons.logo} />

        <div>
          <Text size={TextSize.large}>Sua plaforma de</Text>
          <Text size={TextSize.large}>estudos online.</Text>
        </div>
      </div>

      <HeroImg iconName={AvailableIcons.hero} />
    </HeroContainer>

    <ButtonContainer>
      <div>
        <StyledButton big iconName={AvailableIcons.study}>Estudar</StyledButton>
        <StyledButton big iconName={AvailableIcons.tv}>Dar aulas</StyledButton>
      </div>

      <Text size={TextSize.small} color={ThemeColors.textLighten}>
        Total de 285 conexões já realizadas
      </Text>
    </ButtonContainer>
  </Container>
);

export default Hero;
